webpackJsonp([0xa62285690cf5],{524:function(a,d){a.exports={pathContext:{frontmatter:{path:"/docs/flex-wrap",title:"Flex Wrap",hasPlayground:!0,initialPlayground:"",redirect:null},html:'<h2>Flex Wrap</h2>\n<p>The <code>flex wrap</code> property is set on containers and controls what happens when\nchildren overflow the size of the container along the main axis. By default\nchildren are forced into a single line (which can shrink elements).</p>\n<p>If wrapping is allowed items are wrapped into multiple lines along the main\naxis if needed. <code>wrap reverse</code> behaves the same, but the order of the lines is\nreversed.</p>\n<p><controls prop="flexWrap"></controls></p>\n<p>When wrapping lines <a href="/docs/align-content"><code>align content</code></a> can be used to specify how the\nlines are placed in the container.</p>'}}}});
